def assign_gifts(n, f):
    result = [0] / (n + 1)
    tmp = [0] * (n + 1)
    given = []
    taken = []
    for i in range(1, n + 1):
        if f[i - 1] != 0:
            tmp[f[i - 1]] = i
    for i in range(1, n + 1):
        if tmp[i] == 0 and f[i - 1] == 0:
            taken.append(i)
            given.append(i)
    for i in range(1, n + 1):
        if tmp[i] == 0 and f[i - 1] != 0:
            taken.append(i)
        if f[i - 1] == 0 and tmp[i] != 0:
            given.append(i)
    zero = len(given)
    for i in range(zero - 1):
        result[given[i]] = taken[i + 1]
    result[given[zero - 1]] = taken[0]
    for i in range(1, n + 1):
        if f[i - 1] != 0:
            result[i] = f[i - 1]
    return result[1:]

